main 
	entity_name * 0 * 5 * 1 
				entity_name * 1 * 5 * 7 
				entity_name * 2 * 5 * 6 
				if entity_variable * 0 * 0 * 0 
	then
	else
		entity_variable * 0 * 0 * 0 
		change_map * 35 * 46 " Abbey.map.hs"
	end

	if entity_variable * 1 * 0 * 0 
	then
	else
		entity_variable * 1 * 0 * 0 
		change_map * 8 * 11 " Cave.map.hs"
	end

	if entity_variable * 2 * 0 * 0 
	then
	else
		entity_variable * 2 * 0 * 0 
		change_map * 17 * 38 " BurialGround.map.hs"
	end

	if quest * 1 * 0 
	   exist_item * 1 * 0 " Quest_tobacco.item.hs"
	then
		setQuestState * 1 * 1 * 10 
	end

	if variable_bigger * 7 * 30 
	then
		if rand * 80 
		then
			setClimate * 0 * 1 
		end

		if rand * 90 
		then
			setClimate * 1 * 1 
			setClimate * 0 * 1 
		end

		variable * 7 * 0 
	end

	incrementVariable * 7 * time 
			if hour * 21 * 23 
	then
		setAmbiance * 1 * 1 
		setAmbiance * 0 * 0 
	else
		if hour * 0 * 6 
		then
			setAmbiance * 1 * 1 
			setAmbiance * 0 * 0 
		else
			setAmbiance * 1 * 0 
			setAmbiance * 0 * 1 
		end

	end

	if climate * 0 
	then
		setAmbiance * 0 * 0 
		setAmbiance * 1 * 0 
	end

	if climate * 1 
	then
		setAmbiance * 0 * 0 
		setAmbiance * 1 * 0 
	end

	if quest * 4 * 0 
	then
		if entity_variable * 3 * 0 * 0 
		then
			entity_variable * 3 * 0 * 1 
			entity_variable * 3 * 1 * 5 
			entity_variable * 3 * 2 * 2 
			entity_variable * 4 * 0 * 1 
			entity_variable * 4 * 1 * 5 
			entity_variable * 4 * 2 * 3 
		end

		if entity_variable * 3 * 3 * 0 
		then
		else
			variable * 3 * 1 
		end

		if variable * 3 * 1 
		   entity_dead * 5 
		then
			variable * 3 * 0 
			setQuestState * 4 * 1 * 27 
		end

	end

end


